import "./style/Navbar.css";

function Navbar() {
  return (
    <nav className="Wrap-Navbar">
      <div className="Title">
        <h2>Rezzyn</h2>
      </div>
      <div className="List-Navbar">
        <ul className="">
          <li>Home</li>
        </ul>
        <ul>
          <li>Coffee</li>
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
